import React from 'react';
import BusinessFinance from '../components/BusinessFinance';
import './Business.css';

function Business() {
  return (
    <div className="business-page">
      <h1>Business Finance</h1>
      <p>Manage your business income and expenses here.</p>
      <BusinessFinance />
    </div>
  );
}

export default Business;
